import "./style.css";

const About = () => {
  return (
    <div className="works">
      <h1>Experiences</h1>
      <p>Company: Paytm Payments Bank</p>
      <p>Role: SDE Intern</p>
      <p>Date: Nov 2020 - on going</p>
      <p>
      <br></br>
Designed storybook of all the components<br></br>
Changed the styling and layout of the whole paytm bank app single-handedly<br></br>
Found and fixed critical bugs ensuring product met product requirements<br></br>
Implemented various checks as assigned by the manager<br></br>
Developed an algorithm with mentor to trigger various events like wishing 
user birthday,festivals etc <br></br>
Successfully completed all the tasks assigned by the team before the given
deadline<br></br>
Worked in fast paced Agile environment on scrum team<br></br>
 
      </p>
      <br />
    </div>
  );
};

export default About;
